B.OB=new A.bF(B.wW,["\u2728 The God of Fortune: Saju Reading","Home","Reports","Shop","Consult","AI Analysis","Daily Fortune","Personality","Face","AI Face Analysis","Palm","AI Palm Reading","Four Pillars","Birth Analysis","Tarot","Card Reading","Zodiac","Star Sign","MBTI","Personality Type","Enneagram","9 Personality Types","Today","Daily Luck","\u203b Results are for reference. Your choices matter most.","\ud83c\udf89 Special Offer!","\u20a948,000 for 1 Year","","No Registration","2 Free Trials","Sign up now for 12-month\npremium service at special price!","Get Started","Refund Policy","Refund Policy (Subscription Service Refund and Cancellation Policy)",'1. Scope of Application\nThis policy applies to all internet-based paid subscription services (hereinafter "Services") provided by us.\n\n2. Subscription Payment and Renewal\n\u2022 Services are automatically charged on a monthly/annual basis.\n\u2022 Users can cancel auto-renewal through My Page or Customer Service before the payment date.\n\u2022 When auto-renewal is canceled, services for the already paid period will continue until expiration.\n\n3. Refund Policy\n\n3-1. Simple Change of Mind Refund\nMonthly Subscription (30-day basis)\n\u2022 Full refund: Within 7 days from payment date AND service usage is 10% or less of total\n\u2022 No refund: After 7 days from payment date\n\nAnnual Subscription (365-day basis)\n\u2022 Full refund: Within 14 days from payment date AND service usage is 10% or less of total\n\u2022 Partial refund for remaining period: After 14 days from payment date\n\u2022 Partial refund amount = Payment amount \u2013 Used months \xd7 Monthly rate \u2013 Penalty (up to 10% of total)\n\n3-2. Refund Due to Service Failure or Error\n\u2022 Users can request refund or period extension if service disruption or malfunction lasts 24+ hours.\n\u2022 Proportional refund for unused days if disruption exceeds 72 hours.\n\n3-3. Force Majeure\n\u2022 Service disruptions due to natural disasters, war, national emergencies may be excluded from refunds.\n\n4. Cancellation Policy\n\u2022 Auto-payment stops from next billing date upon cancellation request.\n\u2022 Already paid amounts are processed according to refund policy regardless of cancellation timing.\n\n5. Refund Request Process\nSubmit the following information via Customer Service or email:\n\u2022 Registered email\n\u2022 Payment details (date, amount)\n\u2022 Refund reason\n\nWe will respond within 5 business days.\nApproved refunds will be processed within 7 business days based on payment method.\n\n6. No Refund for Fraudulent Use\nRefunds may be denied for:\n\u2022 Terms violations (account sharing, system abuse)\n\u2022 Abnormal usage patterns (repeated refund requests)\n\u2022 Unauthorized use of third-party payment methods\n\n7. Policy Changes\nThis refund and cancellation policy may change due to legal amendments or service policy updates. Changes will be announced at least 7 days in advance.',"Sign Up","Start 12-Month Premium Service","Sign Up","Welcome!","Start your 12-month premium service","Name","Enter your name","Please enter your name","Gender","Male","Female","Birthdate (Solar)","YYYY-MM-DD","Please select your birthdate","Email","example@email.com","Please enter your email","Invalid email format","Payment","1-Year Premium Service","\u20a948,000","Select payment method","Bank Transfer","Kakao Pay","Naver Pay","Mobile","Sign Up","Please select gender","Please select payment method","Complete!","Registration complete! Enjoy 12-month premium service!","Confirm","Error","\ud83c\udf0d Global 6-Language Service","Language","Chatbot","How can I help you?","Back to question list","Frequently Asked Questions","Can you analyze my face just by uploading a photo?","Yes. When you upload a face photo, the AI analyzes your facial shape, proportions, and key features to provide a simple personality and tendency interpretation.\n(Better accuracy with good lighting and a forward-facing photo.)","Can the system also analyze palm lines?","Yes. The AI detects major palm lines such as the life line, head line, and heart line, then summarizes health, personality, and career-related tendencies.","How is the Four Pillars (Saju/Bazi) analysis done?","Enter your birth date and time, and the system automatically calculates heavenly stems, earthly branches, five elements distribution, and major luck cycles, then provides a full report.","Do you also provide Tarot readings?","Yes. You can choose 3-card, 5-card, or Celtic Cross spreads, and the system generates an automatic interpretation based on your situation.","Can I get one combined report using face, palm, Saju, and Tarot?",'Yes. All four types of data can be integrated into a "Comprehensive Fortune Report,"\ncovering personality, love, wealth, health, and future trends.',"Do you recommend talismans or spiritual goods?","Yes. Based on your analysis results, the system recommends personalized items related to required elements or beneficial energy.\n(Purchases are optional.)","Is 1:1 consultation with an advisor available?","Yes. You can book a chat or video session with professional advisors (Saju, face reading, palm reading, Tarot).\nChoose a time \u2192 make payment \u2192 start consultation.","Are my photos stored safely?","Yes. Sensitive data is encrypted and automatically deleted after 30\u201390 days.\nIt will never be shared externally.","How does payment work?","We support credit cards and fast payment options (such as Toss or Kakao Pay).\nYour payment status is confirmed instantly.","Do you support multiple languages?","Yes. We support Korean, English, Chinese, Japanese, Vietnamese, French, and Spanish.\n(The app detects language automatically and can be manually changed.)","Where can I see my saved reports and photos?","You can check all reports, consultation history, and order history in the MY Page section.","What should I do if the photo isn't recognized well?","Use a forward-facing photo with good lighting and no blur.\nFor palm photos, spread your fingers and ensure the whole palm is visible.","Are the results too absolute or extreme?","No. AI analysis is for reference only.\nStrong or negative statements are automatically filtered.\nOnly safe and gentle interpretations are provided.","Is there a subscription service?","Yes. A monthly subscription includes:\n1 premium report per month\nConsultation discounts\nTalisman discount coupons\nMonthly fortune notifications","Can I use the service without extra payment for Tarot or consultations?","Some features such as real-time consultation require additional payment.\nBasic face analysis and simple Saju summaries are free.","\u2600\ufe0f Today's Fortune","Overall","Love","Money","Health","Work","\ud83c\udf40 Today's Luck","Lucky Number","Lucky Color","Lucky Item","Today's Advice","Refresh","\u2b50 Zodiac Fortune","Select Your Zodiac Sign","Find your zodiac based on your birthday","Choose Again","Today's Fortune","Personality Traits","Lucky Elements","Lucky Day","\ud83e\udde0 MBTI Analysis","Select Your MBTI Type","Choose from 16 personality types","Analysts","Diplomats","Sentinels","Explorers","Description","Traits","Strengths","Career Suggestions","Face Reading","AI analyzes your face photo\nfor physiognomy reading","Take Photo","Upload Photo","Analyzing...","Palm Reading","AI analyzes your palm photo\nto reveal your destiny","Four Pillars","Enter your birth date and time\nto check your Saju","Birth Date","Birth Time","Gender","Analyze Saju","Enter your birth date","Tarot Cards","Think of your question\nand select cards","Tarot Card Reading","Read the future with tarot cards","Question","e.g., How is my love life?","Please enter a question","Number of Cards","One Card","Three Cards","Five Cards","Start Reading","Drawing cards...","Tarot Reading Guide","Answer to a simple question","Past-Present-Future flow","Complex situation analysis","Select Cards","Card Reading","All","Talisman","Accessory","Service","Product Detail","Description","reviews","Add to Cart","added to cart","View","Cart feature is coming soon","Traditional talisman crafted with care. Brings luck and fortune.","Special accessory to boost your fortune. Wear it daily for best effect.","Premium service with expert analysis. Detailed report provided.","Coming Soon","Expert consultation feature will be added soon.\nPlease stay tuned!","Fortune-related product shopping feature will be added soon.\nPlease stay tuned!","Analysis Complete!","Confidence","Analysis Result","Detailed Information","Share feature coming soon","Photo Guide","Bright Lighting","Take photos in a well-lit area so your face is clearly visible","Front View","Position your face directly facing the camera","Close Distance","Get close so your face fills the frame","Natural Expression","Keep a relaxed and natural expression","\u203b Photos are deleted immediately after analysis for privacy protection.","An error occurred during analysis","Palm Reading Guide","Open Palm","Spread your palm wide so lines are clearly visible","Clear Lines","Focus on making palm lines sharp and visible"],t.l)
